const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content part={part1} count={exercises1}/>
      <Total sum={exercises1+exercises2+exercises3} />
    </div>
  )
}

const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      {props.part} {props.count}
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>
        <Part>name = part1 count=exercises1</Part>
        <Part>name = part2 count=exercises2</Part>
        <Part>name = part3 count=exercises3</Part>
      </p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
        Number of exercises {props.sum}
      </p>
    </div>
  )
}

export default App
